import React from "react";
import "./NavigationBar.css";

const NavigationBar = () => {
    return (
        <section>
            <ul className="nav-bar">
                <ul>Intro</ul>
                <ul>Natural Selection</ul>
                <ul>Survival Game</ul>
                <ul>Quiz</ul>
                <ul>Darwin's Bio</ul>
                <ul>Glossary</ul>
            </ul>
        </section>
    );
};

export default NavigationBar;
